import React from 'react'
import './banner.scss'
const Banner = () => {
  return (
    <div className='banner'>
    
    <div className='banner-item1'></div>
   
    <div className='banner-item2'></div>
    <div className='banner-item3'></div>

    
    </div>
  )
}

export default Banner
